import React from "react";
import PropTypes from "prop-types";
import * as opentype from "opentype.js";

const DisplayFont = ({ fontName }) => {
  return (
    <div>
      <p>{fontName}</p>
    </div>
  );
};

DisplayFont.propTypes = {
  fontName: PropTypes.string.isRequired
};

export default DisplayFont;
